    "    X = sm.add_constant(X)\n",
    "    y = t2.loc[t2.index[1]:, 'tweets'].values\n",
    "    model = sm.OLS(y,X).fit()\n",
    "    pred_y = model.predict(X)\n",
    "    print(\"MSE for %s  for between Feb 1: %.6f\" % (tweetfile, mean_squared_error(y,pred_y)))\n",
